import React, {useEffect, useState} from 'react';
import './App.css';

function Interviews() {

  useEffect(() => {
  	fetchItems();
  },[]);

  const fetchItems = async() => {
  	const data = await fetch(
  		"http://localhost:3000/api/v1/interviews"
  		);

  	const items = await data.json();
  	console.log(items);
  };
  return (
    <div>
      <h1> Interviews </h1>
    </div>
  );
}

export default Interviews;
